import React from 'react'
import { Button } from '@mui/material'
const Buttin = () => {
  return (
    <div>
        <Button variant='contained'>First</Button>
        <Button variant='outlined'>Second</Button>
        <Button variant='text'>Thidd</Button>
    </div>
  )
}

export default Buttin
